import { Row, Col, Form, Input } from "antd";

const LinkComp = ({ name, label }) => {
  return (
    <Row gutter={16} align="middle">
      <Col span={22}>
        <Form.Item name={name} label={label}>
          <Input />
        </Form.Item>
      </Col>
      <Col span={2}>
        <ion-icon name="checkmark"></ion-icon>
      </Col>
    </Row>
  );
};

export default LinkComp;
